function ViewClasses({ classes, onClick }) {
    return (
        <section className="view-classes">
            {classes.map((item) => {
                return (
                    <button key={item.id} id={item.id} className="view__link" onClick={onClick}>{item.name}</button>
                )
            })}
        </section>
    );
}

export default ViewClasses;
